            if (documents[documentHashes[i]].owner == _owner) {
                count++;
            }
        }

        string[] memory result = new string[](count);
        uint index = 0;

        for (uint i = 0; i < documentHashes.length; i++) {
            if (documents[documentHashes[i]].owner == _owner) {
